import React from 'react'
import './achievement.scss'

function Achievement() { 
    return ( 
        <div className="container"> 
            <div className="award"> 
                <div className="d-flex mb-3"> 
                    <img src="/static/images/human.jpg" alt="logo"/>  
                    <h1>About Me</h1> 
                </div> 
            </div> 
        </div> 
    )
}

export default Achievement;
